import styled from 'styled-components';

// assuming 12 hour time
const HourOptions = [
  '12:00',
  '1:00',
  '2:00',
  '3:00',
  '4:00',
  '5:00',
  '6:00',
  '7:00',
  '8:00',
  '9:00',
  '10:00',
  '11:00'
];

const AM_PM = [
  ' AM',
  ' PM'
];

const HourSelector = ({

}) => {
  console.log([...HourOptions + AM_PM[0]]);

  return null;
};

export default HourSelector;
